/*Table structure for table `approver_logic` */

DROP TABLE IF EXISTS `approver_logic`;

CREATE TABLE `approver_logic` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `text` varchar(45) DEFAULT NULL COMMENT '审批者逻辑的代码，如果是其他系统的插件，则该字段为其他系统的Signature字段。',
  `value` int(11) DEFAULT NULL,
  `type` varchar(45) DEFAULT NULL COMMENT '审批者逻辑的类型，比如说：系统、逻辑',
  `name` varchar(45) DEFAULT NULL COMMENT '审批者逻辑的中文表述',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id_UNIQUE` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

