(40,0,20,1,'2021-10-28 14:48:58','2021-10-28 14:51:41','LIMIT 语句：\r\n	LIMIT n表示列举该表的前n行\r\n	LIMIT n,m 表示列举该表从第n行开始列m行\r\n	LIMIT 1,1 查询的是第2行，因为MySQL是从第0行开始查询的\r\n\r\nORDER BY：\r\n	ORDER BY c1，c2：先对c1进行排序，再对c2进行排序，如果c1所有的值		都是唯一的，那么c2不会被排序，因此c1排好了，c2只有在c1有重复元组		的才能进行变化\r\n\r\nORDER BY 和 LIMIT通常一起使用，LIMIT在ORDER BY的后面，可以查询前几名，或者后几名\r\n\r\n',0,'sdfsdgds',0,'rsfgsegv','必知必会sql.txt',1,0,'0.50',2,NULL,'6863835d0571210cc997a49b0ed76c5a'),
