/*Table structure for table `work_order_history` */

DROP TABLE IF EXISTS `work_order_history`;

CREATE TABLE `work_order_history` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `create_time` datetime DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  `deleted` int(11) DEFAULT NULL,
  `work_order_id` int(11) DEFAULT NULL,
  `before_finished_flow_node_id` int(11) DEFAULT NULL COMMENT '记录工单结束前的审批节点id',
  `before_finished_status` varchar(45) DEFAULT NULL COMMENT '工单结束前状态',
  PRIMARY KEY (`id`),
  UNIQUE KEY `idwork_order_history_UNIQUE` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=26 DEFAULT CHARSET=utf8;

